import React from 'react'
import './Card.css';

const Card = () => {
  return (
    <>
      <div className="outer_box">
        <h2>Smart Attendance System</h2>
        <p>An Attendance system based on facial recognition</p>
      </div>
    </>
  )
}

export default Card
